import styled from "styled-components";
export const EmptyWrapper = styled.div`
  display: flex;
  flex-direction: column;
  align-items: center;
  padding: 3rem 0;
  width: 100%;
  height: 100vh;
  .empty-text {
    font-size: 1.75rem;
  }
`
